{
  "name": "UBX-NAV-SLAS",
  "class_id": 1,
  "message_id": 66,
  "description": "QZSS L1S SLAS status data",
  "message_type": "periodic_polled",
  "payload_length": {
    "variable": {
      "base": 20,
      "formula": "20 + cnt * 8"
    }
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U4",
      "name": "iTOW",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See the description of iTOW for details."
    },
    {
      "byte_offset": 4,
      "data_type": "U1",
      "name": "version",
      "fixed_value": 0,
      "description": "Message version (0x00 for this version)"
    },
    {
      "byte_offset": 5,
      "data_type": {
        "array_of": "U1",
        "count": 3
      },
      "name": "reserved1",
      "reserved": true
    },
    {
      "byte_offset": 8,
      "data_type": "I4",
      "name": "gmsLon",
      "scale": {
        "raw": "1e-3",
        "multiplier": 0.001
      },
      "unit": "deg",
      "description": "Longitude of the used ground monitoring station"
    },
    {
      "byte_offset": 12,
      "data_type": "I4",
      "name": "gmsLat",
      "scale": {
        "raw": "1e-3",
        "multiplier": 0.001
      },
      "unit": "deg",
      "description": "Latitude of the used ground monitoring station"
    },
    {
      "byte_offset": 16,
      "data_type": "U1",
      "name": "gmsCode",
      "description": "Code of the used ground monitoring station according to the QZSS SLAS Interface Specification, available from qzss.go.jp/en/"
    },
    {
      "byte_offset": 17,
      "data_type": "U1",
      "name": "qzssSvId",
      "description": "Satellite identifier of the QZS/GEO whose correction data is used (see Satellite Numbering)"
    },
    {
      "byte_offset": 18,
      "data_type": "X1",
      "name": "serviceFlags",
      "description": "Flags regarding SLAS service (see graphic below)"
    },
    {
      "byte_offset": 19,
      "data_type": "U1",
      "name": "cnt",
      "description": "Number of pseudorange corrections following"
    },
    {
      "byte_offset": 20,
      "data_type": {
        "array_of": {
          "item_length": 8,
          "fields": [
            {
              "byte_offset": 0,
              "data_type": "U1",
              "name": "gnssId",
              "description": "GNSS identifier (see Satellite Numbering)"
            },
            {
              "byte_offset": 1,
              "data_type": "U1",
              "name": "svId",
              "description": "Satellite identifier (see Satellite Numbering)"
            },
            {
              "byte_offset": 2,
              "data_type": "U1",
              "name": "reserved2",
              "reserved": true
            },
            {
              "byte_offset": 3,
              "data_type": {
                "array_of": "U1",
                "count": 3
              },
              "name": "reserved3",
              "reserved": true
            },
            {
              "byte_offset": 6,
              "data_type": "I2",
              "name": "prc",
              "unit": "cm",
              "description": "Pseudorange correction"
            }
          ]
        },
        "count_field": "cnt"
      },
      "name": "correctionsData"
    }
  ]
}
